  return (
    <div className="stats-box">
      <h2>ðŸ“Š Event Stats</h2>
      <ResponsiveContainer width="100%" height={200}>
        <BarChart data={eventStats}>
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Bar dataKey="count" fill="#4CAF50" />
        </BarChart>
      </ResponsiveContainer>
    </div>
  );
};

export default EventStats;
